import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    welcomeText:{
      fontSize:18,
      fontWeight:'bold',
      marginBottom:10,
    },
    input:{
      fontFamily:'initial',
      marginBottom:10,
    },
    errorText: {
      color:'red',
      marginBottom:10,
    },
    horizontalButtonContainer: {
      flexDirection: 'row',
      justifyContent: 'space-betw',
      marginTop: 20,
      paddingHorizontal:20, 
    },
    horizontalButton: {
      width: '10%',
    },

  });
  export {styles}
